import matplotlib.pyplot as plt
import numpy as np

def create_pixel_grid(figure_data):
    # Convert the figure data to a NumPy array
    figure_data = np.array(figure_data)

    # Create a figure and axes
    fig, ax = plt.subplots()

    # Display the image
    ax.imshow(figure_data, cmap='gray')

    # Remove the axes
    ax.axis('off')

    # Show the plot
    plt.show()

